import React from "react";

export const Card_Person = ({ img, name, known_for }) => {
  return (
    <div>
      <div>
        <img src={`https://image.tmdb.org/t/p/w500${img}`} alt="actor_pic" />
      </div>
      <div>{name}</div>
      <div>{known_for[0].title}</div>
    </div>
  );
};

export default Card_Person;
